    {
        $classpath = eaccelerator_get("fw:root:autoload:map:1399633835");
        if ($classpath) return $classpath;

        $classpath = getClassMapDef();
        eaccelerator_put("fw:root:autoload:map:1399633835",$classpath); 
    }
    else
    {
        $classpath = getClassMapDef();
    }
    return $classpath;
}
